import React from 'react'

import './Bookmarks.scss'

const Bookmarks = () => {
  return (
    <div className='bookmarks'>
        <div className="bookmarks__header">
        <h1>Мои закладки</h1>
        <Input
          size="large"
          style={{ width: 250, height: 37 }}
          placeholder="Поиск..."
          prefix={<Search color='#E4E4E4' />}
        />
      </div>
    </div>
  )
}

export default Bookmarks
